import React, { Component } from 'react';
import './App.css';


export class App extends Component () {

  setBoard() {
    for(let i=0; i <= 9; i++){
        console.log({i});
    }
  }


  render() {

    return(
      <div className="App">
        <header className="App-header">
          hello world
        </header>
      </div>
    )

  }

};


export default App;
